import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Profile from './components/Profile/Profile';
import Dialogs from './components/Dialogs/Dialogs'
import { Route } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import MyCalendar from './components/MyCalendar/MyCalendar';
import Watchlist from './components/Watchlist/Watchlist';
const App = (props) => {


  return (
    <BrowserRouter>
      <div className='app-wrapper'>
        <Header />
        <Navbar />
        <div class='app-wraper-content'>

          <Route path='/Dialogs' render={() => <Dialogs dialogsData={props.state.messagesPege.dialogsData} messages={props.state.profile.messages} />} />
          <Route path='/Profile' render={() => <Profile postData={props.state.messagesPege} />} />
          <Route path='/Watchlist' render={() => <Watchlist />} />
          <Route path='/MyCalendar' render={() => <MyCalendar />} />

        </div>
      </div>
    </BrowserRouter>
  );
}



export default App;
